    return(
        <div className="w-50">
            <table className="table table-bordered">
                <tbody>
                    <tr>{renderedHeaders}</tr>
                </tbody>
                <tbody>
                    <tr>{renderedRows}</tr>
                    <tr>{renderedRows}</tr>
                </tbody>
            </table>
        </div>
    )
}
